&lt;br />
&lt;b>Добавлено:&lt;/b>&lt;br />
&lt;div class="additions">&lt;ul>&lt;li>&lt;ul>&lt;li> Первоочередность направлений. Список из&amp;nbsp;3 первых ID-направлений, куда будет уходить трафик в&amp;nbsp;первую очередь;
&lt;/li>&lt;li> Прямого направления (direct route). Безусловная маршрутизация трафика без&amp;nbsp;контроля цены и&amp;nbsp;качества;
