<item>
<title>2007-06-26 18:16:24</title>
<link>http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/DealerSection/DealerInfo/show&amp;time=2007-06-26+18%3A16%3A24</link>
<description>&lt;div class="pageBefore">&lt;img src="http://78.46.73.113/wiki/images/z.gif" width="1" height="1" border="0" alt="" style="display:block" align="top" />&lt;/div>&lt;div class="page">
&lt;b>Сравнение версий &lt;a  href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/DealerSection/DealerInfo&amp;amp;v=1353" class="">/Документация&amp;nbsp;IP&amp;nbsp;Studio&amp;nbsp;AMBS&amp;nbsp;/&amp;nbsp;Dealer&amp;nbsp;Section&amp;nbsp;/&amp;nbsp;Dealer&amp;nbsp;Info&lt;/a> за &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/DealerSection/DealerInfo&amp;amp;time=2007-06-26+18%3A16%3A24">2007-06-26 18:16:24&lt;/a> и &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/DealerSection/DealerInfo&amp;amp;time=2007-07-10+12%3A58%3A51">2007-07-10 12:58:51&lt;/a>&lt;/b>&lt;br />
&lt;br />
&lt;b>Добавлено:&lt;/b>&lt;br />
&lt;div class="additions">Дилерский доступ в&amp;nbsp;IP Studio AMBS предоставляет полный доступ в&amp;nbsp;управлении вручную маршрутизацией для&amp;nbsp;вызовов тех&amp;nbsp;операторов, которые закреплены за&amp;nbsp;дилером.&lt;br />
Дилер может назначить для&amp;nbsp;каждого оригинирующего направления, закрепленного за&amp;nbsp;ним, оператора:&lt;br />
&lt;div class="indent">&lt;div class="indent">&lt;br />
&lt;/div>&lt;ul>&lt;li> Первоочередность операторов. Список из&amp;nbsp;3 первых операторов, куда будет уходить трафик в&amp;nbsp;первую очередь;
&lt;/li>&lt;li> Прямого оператора (direct route). Безусловная маршрутизация трафика без&amp;nbsp;контроля цены и&amp;nbsp;качества;
&lt;/li>&lt;li> Лист запрещенных операторов. Список терминаторов, куда звонки по&amp;nbsp;этому направлению не&amp;nbsp;будут проходить;
&lt;/li>&lt;li> Приоритет выбора терминаторов: по&amp;nbsp;цене, по&amp;nbsp;качеству, по&amp;nbsp;ASR и&amp;nbsp;т.д.;
&lt;/li>&lt;li> Минимальный процент прибыли с&amp;nbsp;выбранного направления для&amp;nbsp;выбранного оригинатора;
&lt;/li>&lt;li> Включить или&amp;nbsp;отключить наличие брекаутов у&amp;nbsp;терминаторов при&amp;nbsp;их&amp;nbsp;выборе;
&lt;/li>&lt;li> Отключить возможность прохождения трафика по&amp;nbsp;более короткому коду, если такой имеется в&amp;nbsp;тарифе оператора;
&lt;/li>&lt;li> Закрыть выбранный код&amp;nbsp;у&amp;nbsp;оригинатора. Трафик этого оператора по&amp;nbsp;этому коду приниматься не&amp;nbsp;будет.&lt;/li>&lt;/ul>&lt;/div>
Таким образом, у&amp;nbsp;оператора, которого курирует дилер будет сведен к&amp;nbsp;минимуму риск непрохождения звонков по&amp;nbsp;каким-либо причинам, возможность иметь в&amp;nbsp;своем распоряжении лучшие роуты по&amp;nbsp;заявленной им&amp;nbsp;цене, решать проблему непрохождения звонков в&amp;nbsp;кратчайшие сроки. Все&amp;nbsp;это делает дилерский доступ незаменимым для&amp;nbsp;любого оператора, предоставляющего услуги &lt;span class="missingpage">Vo&amp;nbsp;IP&lt;/span>&lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=VoIP/edit&amp;amp;add=1" title="Создать эту страницу">?&lt;/a>.&lt;/div>&lt;br />
&lt;b>Удалено:&lt;/b>&lt;br />
